import React from 'react';
import { BrowserRouter as Router,Switch, Route, Link, Redirect } from "react-router-dom";
import Header from './Components/header';
import Footer from './Components/footer';
import Gallery from './Pages/gallery';
import bottleHolders from '../imgs/bottleHolders';
import lunchBoxes from '../imgs/lunchboxes';
import makeupBags from '../imgs/makeupBags';
import pencilCases from '../imgs/pencilcases';
import sets from '../imgs/sets';

const Routes = ()=>{
    let lunchBoxesGallery = <Gallery imgsDetails={lunchBoxes}/>;
    let pencilCasesGallery = <Gallery imgsDetails={pencilCases}/>;
    let makeupBagsGallery= <Gallery imgsDetails={makeupBags}/>;
    let bottleHoldersGallery = <Gallery imgsDetails={bottleHolders}/>;
    return(
        <Router>
        <Switch>
            <Header/>
            <Route path="/loncheras" exact>
                <Gallery imgsDetails={lunchBoxes}/>
            </Route>
            <Route path="/estucheras" exact><Gallery imgsDetails={pencilCases}></Gallery></Route>
            <Route path="/cosmetiqueras" exact><Gallery imgsDetails={makeupBags}></Gallery></Route>
            <Route path="/portabotellas" exact><Gallery imgsDetails={bottleHolders}></Gallery></Route>

            <Redirect to="/loncheras"/>

        </Switch>
    </Router>
    );

}

export default Routes;
